import { useEffect, useState } from "react";
import { getPosts } from "../services/posts";

const Posts = () => {
  const [posts, setPosts] = useState([]);
  useEffect(() => {
    getPosts().then(posts => {
      console.log(posts);
      setPosts(posts);
    }, []);
  });
  return (
    <div>
      {posts.map(post => (
        <div key={post.id}>
          <h2>{post.title}</h2>
        </div>
      ))}
    </div>
  );
};

export default Posts;
